import React from "react";

const Buzzes = ({ buzz }) => {
  return (
    <div>
      <h1>{buzz.message}</h1>
      <div>{buzz.name}</div>
      <div>{buzz.username}</div>
    </div>
  );
};

export default Buzzes;
